function Todo({todoText, todoId}) {
    console.log(todoText);
    return (

        <div className="todo" key={todoId}>
            <div className="todoText">
            {todoText}
            </div>
            <span className="tools">
            <span className="edit-icon">-</span>
            <span className="delete-icon">x</span>
            </span>
        </div>
    )
}

export default Todo
